import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Header from "./components/Header";
import React from "react";

//import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="p-6 ">
      <Router>
        <Header />
        <Routes>
          <Route />
          <Route />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
